SUMMARY OF PRINCIPAL RISK FACTORS
We face risks from:
•our dependence on the commercial success of our products, ILUVIEN and YUTIQ; •the competition we face, given that the number of competitive products is growing and our competitors include larger, more established, fully integrated pharmaceutical companies and biotechnology companies that have substantially greater capital resources, existing competitive products, larger research and development staffs and facilities, greater marketing capabilities, and greater experience in drug development and in obtaining regulatory approvals than we do;

•our inability to expand our portfolio of ophthalmic products;
•the negative effects of inflation, which may increase the compensation we must pay to retain and attract a high-quality workforce and is likely to increase our operational costs;
•our dependence on single-sourced third-party manufacturers to manufacture our products or any future products or product candidates in sufficient quantities and quality, in a timely manner and at an acceptable price; •the possibility that we may fail to plan appropriately to meet the demand of our customers for our products , which could lead either to (a) our products being out of stock or (b) our investment of a greater amount of cash in inventory than we need;

•the possibility that the issues affecting global supply chains may negatively impact our ability to source materials and components to make our products or to deliver our products into our current markets;
•uncertainty associated with manufacturing components and materials being superseded or becoming obsolete;
•the possibility that we may fail to comply with the financial covenants in our credit facility, and in that event be unable to obtain a waiver for any resulting default;
•the possibility we need to raise additional financing, the terms of which may restrict our operations and, if the capital we raise is equity or a debt security that is convertible into equity, could dilute our stockholders’ investment;
•uncertainty regarding our ability to achieve profitability and positive cash flow through the commercialization of ILUVIEN in the U.S., the EEA and other regions of the world where we sell ILUVIEN;
•uncertainty regarding our ability to achieve profitability and positive cash flow through the commercialization of YUTIQ in the U.S. to treat chronic NIU-PS;
•a slowdown or reduction in our sales due to, among other things, a reduction in end user demand, unexpected competition, regulatory issues or other unexpected circumstances;
•the effects of inflation on the SOFR-based interest rate we pay under our credit facility, which could cause our financing costs to increase materially and thus adversely affect our financial results;
•the possible continued delays in enrollment of patients in our current or future studies;
•the possible delay in enrollment of patients in our pediatric study for NIU-PS;
•uncertainty associated with our pursuit of reimbursement from local health authorities in certain countries for the recently obtained additional indication for ILUVIEN for NIU-PS;
•delay in or failure to obtain regulatory and reimbursement of ILUVIEN and YUTIQ or any future products or product candidates in additional markets where we do not currently sell ILUVIEN and YUTIQ;
•uncertainty associated with our ability to meet any post market requirements for NIU-PS in the EEA;
•the possibility that we may fail to secure regulatory approval in the greater China market, which would have an adverse effect on our ability to receive milestone payments under the Ocumension license agreement;
•uncertainty associated with our ability to successfully commercialize ILUVIEN and YUTIQ following regulatory approval in additional markets; and
•the possibility that we may be adversely affected by the expiration of patents that protect key aspects of our products in the near- to medium-term.
