16 Risks Related to Our BusinessOur business depends on our products, ILUVIEN and YUTIQ.We are a pharmaceutical company with two products, ILUVIEN, currently available for commercial sale in the U.S., the U.K., most of the countries in the EEA and a limited number of other markets, and our other product, YUTIQ, available for commercial sale in the U.S. Because we do not currently have any other products or product candidates available for sale or in clinical development, our future success depends on our and our distributors’ successful commercialization of ILUVIEN and YUTIQ.We market ILUVIEN directly in the U.S., Germany, the U.K., Portugal and Ireland. In addition, we have entered into various agreements under which distributors are providing or will provide regulatory, reimbursement and sales and marketing support for ILUVIEN in Austria, Belgium, the Czech Republic, Denmark, Finland, France, Italy, Luxembourg, the Netherlands, Norway, Spain, Sweden, Switzerland, Australia, New Zealand and several countries in the Middle East. In addition, we have granted an exclusive license to Ocumension for the development and commercialization of our 0.19 mg fluocinolone acetonide intravitreal injection in China, East Asia and the Western Pacific. As of December 31, 2023 we have recognized sales of ILUVIEN to international distributors in the Middle East, China, Austria, Belgium, Czech Republic, France, Italy, Luxembourg, Spain, the Netherlands, and certain Nordic countries.In the U.S., YUTIQ is indicated for the treatment and prevention of chronic NIU-PS. Pursuant to the Product Rights Agreement with EyePoint Parent, we have the commercialization rights to YUTIQ in the entire world, except Europe, the Middle East and Africa as we had previously licensed from EyePoint rights to certain products, which included YUTIQ (known as ILUVIEN in Europe, the Middle East and Africa) for the prevention of relapse in recurrent NIU-PS in those territories. The Product Rights Agreement also excludes any rights to YUTIQ for the treatment and prevention of chronic NIU-PS in China and certain other countries and regions in Asia, which rights are subject to a pre-existing exclusive license between EyePoint Parent and Ocumension.We have incurred and expect to continue to incur significant expenses:•to continue to support our sales efforts in the U.S., Germany, Portugal, the U.K. and Ireland;•to pursue the regulatory and reimbursement approval for ILUVIEN in other countries for both DME and NIU-PS;•to grow our operational capabilities;•to support our NEW DAY and SYNCHRONICITY Studies; and•to support our NIU-PS study in pediatric patients.These represent a significant investment in the commercial and regulatory success of our products, which is uncertain.If we or our distributors do not successfully maintain our sales in countries where we are approved to sell our products or our distributors do not successfully commence and grow our sales of our products in other countries where we are seeking to begin selling our products or have recently done so, our business may be seriously harmed. In addition, we may experience delays and unforeseen difficulties in the commercialization of our products , including unfavorable pricing or reimbursement levels in certain countries that could negatively affect our ability to increase revenues.We face substantial competition, which may result in others discovering, developing or commercializing competing products before or more successfully than we do.The development and commercialization of new drugs is highly competitive, and the commercial success of our products or any of our future products or product candidates will depend on several factors, including our ability to differentiate any such products or product candidates from our competitors’ current or future products. We face competition from major pharmaceutical companies, specialty pharmaceutical companies and biotechnology companies worldwide with respect to our current products and to any future products or product candidates that we may develop or commercialize in the future.Our commercial opportunities for our current products will be reduced or eliminated if our competitors develop or market products that:•are more effective;•receive better reimbursement terms;•have higher rates of acceptance by physicians;•have fewer or less severe adverse side effects;•are better tolerated;•are more adaptable to various modes of dosing;•have better distribution channels;•are easier to administer; or

pertain to the maintenance of records that in reasonable detail accurately and fairly reflect the transactions and dispositions of our assets;
provide reasonable assurance that transactions are recorded as necessary to permit preparation of financial statements in accordance with generally accepted accounting principles, and that our receipts and expenditures are being made only in accordance with authorizations of our management and directors; and
provide reasonable assurance regarding prevention or timely detection of unauthorized acquisition, use or disposition of our assets that could have a material effect on our financial statements. Under the supervision and with the participation of management, including our principal executive and financial officers, we assessed our internal control over financial reporting as of December 31, 2022, based on criteria for effective internal control over financial reporting established in the 2013 Internal Control — Integrated Framework issued by the Committee of Sponsoring Organizations of the Treadway Commission (“COSO”).
